import React from "react";
import Navbar from "./components/Navbar";
import {Card} from '@mantine/core'
import Event from "./Event";

function Home(){
    return(
        <div>
        <header>
        <Navbar/>
        </header>
        <body className="content">
        <Card className="Card" withBorder><Event/></Card>
        </body>
        </div>
    )
}

export default Home;
